import { Link } from 'react-router-dom';
import './Profile.css';
import { connect } from 'react-redux';
import DragAndDrop from './DragAndDrop'
import { DragAndDropReducer } from '../../redux/reducers/draganddrop/DragAndDrop'
import store from '../../redux/store/store'

const PostBlock = (props) => {
  const [headline, setHeadline] = useState("Headline");
  const [postText, setPostText] = useState("");

  return (
    <div className="col-4 post-block">
        <div className="profile-block d-flex justify-content-end">
            <div className="profile-name">Name</div>
            <div className="profile-photo">profile-photo</div>
        </div>

    </div>
  );
}

const mapStateToProps = state => {
  return {
    data: state.DragAndDropReducer

  };
};

//const mapDispatchToProps = {
//  logout
//}

export default connect(
  mapStateToProps,
//  mapDispatchToProps
)(PostBlock)
